export default ()=>{
    const profile = null ;
    useEffect(() => {
        axios.get('http://localhost:9000/profiles/')
        .then(res =>{
            console.log(res.data.response.profiles);
            profile = res.data.response.profiles ;
        })
        .catch(err =>console.log(err));
      });
    return(
        <div>
            <Header/>
            <Head/>
            {profile[0].nom}
        </div>
    )
}
